class Solution(object):
    def replaceDigits(self, s):
        alp = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't', 'u', 'v',
         'w', 'x', 'y', 'z']
        x = list(s)
        self.size = len(s)
        if self.size % 2 == 1:
            self.size -= 1
        for i in range(0, self.size, 2):
            x[i+1] = alp[alp.index(x[i]) + int(x[i + 1])]

        return "".join(x)
cevap = Solution()
print(cevap.replaceDigits("a1b2c3d4e"))


class Solution:
    def maximumElementAfterDecrementingAndRearranging(self, arr: list):
        print(arr)
        arr = sorted(arr)
        arr[0] = 1
        print(arr)
        for i in range(1, len(arr)):
            if abs(arr[i] - arr[i - 1]) > 1:
                arr[i] = arr[i - 1] + 1
        print(arr)
        return max(arr)


cevap = Solution()
print(cevap.maximumElementAfterDecrementingAndRearranging([73, 98, 9]))


class Solution:
    def closestRoom(self, rooms, queries):
        cevap = []
        for k in queries:
            adaylar = [9999999]
            flag = 0
            for i in rooms:
                if k[1] <= i[1]:
                    flag += 1
                    if abs(k[0] - i[0]) < adaylar[-1]:
                        adaylar.append(i[0])
            if flag == 0:
                cevap.append(-1)
            else:
                cevappp = 0
                temp = k[0]*1000
                for i in adaylar:
                    x = abs(k[0] - i)
                    if temp > x or (i < cevappp and temp == x):
                        temp = x
                        cevappp = i
                cevap.append(cevappp)
        return cevap


